import React from 'react';
import {Nav, Navbar} from 'react-bootstrap';
import {HiMenu} from 'react-icons/hi';

const menubar = (props) =>
{
    return
    (
        <Navbar bg="light">
            <Nav.Link href ="#menu"><HiMenu /></Nav.Link>
            <Navbar.Brand>{props.children}</Navbar.Brand>
        </Navbar>
    )
};

export default menubar;
